.panelGroup {
    width: 100%;
    height: 100%;
    // padding-top: 5%;
    display: flex;
    flex-direction: column;

    // 搜索框
    .search {
        display: flex;

        .el-input {
            width: 515px;
            height: 40px;

            .el-input__inner {
                height: 100%;
            }

            .el-button {
                width: 75px;
                height: 40px;
                font-size: 16px;
                background: #84C22E;
                color: #fff;
            }
        }
    }

    // 历史记录
    .history {
        width: 500px;
        h5 {
            display: flex;
            justify-content: space-between;
            align-items: center;
            color: #84C22E;
            span {
                font-weight: 400;
            }
        }

        .historyList {
            max-height: 75px;
            overflow: auto;
            .el-tag {
                height: 30px;
                margin: 5px;
                line-height: 28px;
                cursor: pointer;
            }
        }

    }

    // 按钮
    .btnList {
        margin-top: 8px;
        display: flex;
        justify-content: space-between;
        width: 100%;
        .el-link {
            width: 20%;
            border-radius: 8px;
            background: #fff;
            padding: 14px 8px;
            .el-link--inner {
                width: 100%;
                display: flex;
                justify-content: space-between;
                align-items: center;
                .icon {
                    width: 50px;
                    height: 50px;
                    background: rgba(0,0,0,0.04);
                    margin-right: 8px;

                }
                .desc {
                    flex: 1;
                    p {
                        margin: 8px 0;
                    }
                    span {
                        font-weight: 700;
                    }
                }
            }
        }
    }
}
